javaImport.importPackage(
	Packages.java.util,
	Packages.java.util.zip,
	Packages.java.io
);
with(javaImport) { 
function inflate(compressedData) {
    var inflater = new Inflater(true);
    var buffer = java.base64DecodeToByteArray(compressedData)
    inflater.setInput(buffer);
    var outputStream = new ByteArrayOutputStream();
    let cac = ""
    for (let i = 0; i <= 181; i++) cac+="000"
    var output = java.strToBytes(cac)
    var count = inflater.inflate(output);
    outputStream.write(output, 0, count);
    inflater.end()
    return outputStream.toByteArray()
}

